import { useSelector, useDispatch } from 'react-redux';
import { useState } from 'react';
import React from 'react';

export const Cal2 = (props) => {
    let globalCount = props.globalCount
    const dist = props.dist
   
    const add = () => {
        alert(dist)
        return props.add(dist)
    }
    const sub = () => {
        alert(dist)

        return props.sub(dist)
    }

    return (
        <div>
            <h1>value {globalCount} </h1>
            <h1><button type="button" onClick={sub}>- {dist}</button>   
            <button type="button" onClick={add}>+ {dist}</button>         
            </h1>
        </div>
    );
};
